using System.Collections.Generic;
using System.IO;

namespace ToastNotification.LogoSourceTests
{
    internal static class Helpers
    {
        public const string Sample = "https://raw.githubusercontent.com/AzureAms/ToastNotification.Uno/master/ToastNotificationDemo/ToastNotificationDemo.Shared/Assets/sample.png";
        public const string DataUrl = "data:;base64,";

        public static byte[] ReadToEnd(this Stream stream)
        {
            var bytes = new List<byte>((int)stream.Length);
            var buffer = new byte[8192];
            int badCount = 0;
            while (badCount < 100)
            {
                var count = stream.Read(buffer, 0, 8192);
                for (int i = 0; i < count; ++i) bytes.Add(buffer[i]);
                if (count == 0)
                {
                    ++badCount;
                }
                else
                {
                    badCount = 0;
                }
            }
            return bytes.ToArray();
        }
    }
}
